import UserForm from './components/user';
import ExpenseForm from './components/userexpenses';
import ExpenseList from './components/allexpenses';

function App() {
  return (
    <div>
      <h1>Expense Tracker</h1>
      <UserForm />
      <ExpenseForm />
      <ExpenseList />
    </div>
  );
}

export default App;
